INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (1, '2019-03-05 12:54:37', '{"displayName":"The game changer","description":"De Fantasia Presents our next Event \\"THE GAME CHANGERS\\" Business Awards 2019, we are welcoming all Big Personalities who proved their name in Business World from all Categories.First time Business Tycoons & Fashion Icons come together in one stage. The GAME CHANGERS 2019 Award show is for most Popular Personalities from Business world, Reputed Companies and names will be there, we highlighting Real Game Changers who help economy with their ideas and concepts.","country":"United States","state":"Oregon","city":"Canadian Alliance","zip":958200,"address1":"45 Jockey Hollow Street Sacramento","address2":"8488 Arlington Road Fairfax","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-10T12:30:00.000Z","eventPreviewUrl":"","totalSeats":20,"eventDuration":20,"actualPrice":15,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":7}],"broadcasterInfo":{"id":1}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (2, '2019-03-05 13:38:34', '{"displayName":"Shed seven","description":"Part of the Britpop explosion, Shed Seven were formed in York in 1990 before signing their first record deal in 1994. The band members were vocalist Rick Witter, bassist Tom Gladwin, guitarist and keyboard player Paul Banks and drummer Alan Leach. Their debut single was followed swiftly by Dolphin, which cracked the top 30. The subsequent single success of Speakeasy led to prime-time television appearances, increased exposure and a higher profile for the Yorkshire-based band.","country":"United States","state":"california","city":"Los Angeles","zip":28201,"address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-12T11:30:00.000Z","eventPreviewUrl":"","totalSeats":10,"eventDuration":25,"actualPrice":15,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":4}],"broadcasterInfo":{"id":1}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (3, '2019-03-05 13:51:00', '{"displayName":"Pale waves","description":"English indie-pop band Pale Waves were formed in 2014 in Manchester, where lead singer and guitarist Heather Baron-Gracie met drummer Ciara Doran whilst attending university.They site the likes of the Blue Nile, The Cranberries and Cocteau Twins as influence as well as the late Prince who’s song Purple Rain is described as one of their favourite songs of all time.","country":"United States","state":"Oregon","city":"Canadian Alliance","zip":95820,"address1":"45 Jockey Hollow Street Sacramento","address2":"8488 Arlington Road Fairfax","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-06T08:30:00.000Z","eventPreviewUrl":"","totalSeats":"100","eventDuration":20,"actualPrice":25,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":4}],"broadcasterInfo":{"id":1}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (4, '2019-03-05 14:00:40', '{"displayName":"Showstopper! the Improvised Musical","description":"With a critically acclaimed West End run, a BBC Radio Four series and nine years of festivals and touring to their name, The Showstoppers have delighted audiences around the world with their ingenious, unique blend of comedy, musical theatre and spontaneity.","country":"United States","state":"california","city":"Los Angeles","zip":2010145,"address1":"45 Jockey Hollow Street Sacramento","address2":"Miami Beach","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-09T09:30:00.000Z","eventPreviewUrl":"","totalSeats":10,"eventDuration":20,"actualPrice":15,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":4}],"broadcasterInfo":{"id":1}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (5, '2019-03-05 17:34:23', '{"displayName":"Retro mania","description":"RETRO MANIA is an online live-show where the artist will perform the good-old classic Bengali retro songs and will spread the magic of bangla soft melody. RETRO MANIA is a series where on episode 1, the artist will focus on the timeless classics of 60s and 70s.","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-12T10:30:00.000Z","eventPreviewUrl":"","totalSeats":20,"eventDuration":15,"actualPrice":20,"pricingRule":{"id":1},"liveStreamConfig":{"id":2},"eventType":[{"id":4}],"broadcasterInfo":{"id":2}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (6, '2019-03-05 17:43:16', '{"displayName":"Sweet light","description":"Amber Sweeney is an accomplished soul/rock singer, songwriter, and recording artist who recently signed with Seattle-based record label, London Tone Music, to release a single as part of their 52x52: A Year In Your Ear project. Her single \\"Lone Sailor,\\" produced by Geoff Ott, was released September 1, 2014 and reached #4 on the iTunes Blues charts upon its release","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-14T10:30:00.000Z","eventPreviewUrl":"","totalSeats":20,"eventDuration":15,"actualPrice":20,"pricingRule":{"id":1},"liveStreamConfig":{"id":2},"eventType":[{"id":5}],"broadcasterInfo":{"id":2}}', 'Event', 'createEvent', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (7, '2019-03-05 17:51:23', '{"displayName":"Soncured Records","description":"Soncured is not a huge corporate record label, we are entirely self funded and conveniently located in East Tennessee.  At our core we believe that Holy Spirit inspired music has the ability to change lives.  Our mission is to find and promote unknown Christian artists who otherwise might never have the opportunity to share the message God has given them with the world","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"PST","eventUtcDatetime":"2019-03-12T06:30:00.000Z","eventPreviewUrl":"","totalSeats":10,"eventDuration":25,"actualPrice":30,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":5}],"broadcasterInfo":{"id":3}}', 'Event', 'createEvent', 1);
