INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (366, '2019-06-10 16:13:13', '{"displayName":"Shadows","description":"There was a time when Daniel Fernandes used to work in advertising. He then hit enlightenment and bid adieu to his fledgling career, and took to stand-up comedy. Daniel’s material is based on his experiences with travel, 69 failed relationships and his favorite Indian community amongst other things, and was recently touring with the show that highlighted his journey as a comedian in the last 5 years. He believes that everything he has to face in life has comic potential so why not just laugh it off? One of the biggest comics in India, he is a regular at Canvas Laugh Club and Comedy Store. He has captured the better side of everyone with his really funny take on various topical issues on YouTube and on stage","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"IST","eventUtcDatetime":"2019-06-18T10:07:26.000Z","eventPreviewUrl":"","totalSeats":"100","eventDuration":50,"actualPrice":40,"pricingRule":{"id":4},"liveStreamConfig":{"id":2},"eventType":[{"id":5}],"broadcasterInfo":{"id":12}}', 'Event', 'createEvent', 1);
