INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (461, '2019-06-14 13:02:05', '{"id":2,"displayName":"Amber","shortDesc":"Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide.","biography":"Amber Sweeney is an accomplished soul/rock singer, songwriter, and recording artist who recently signed with Seattle-based record label, London Tone Music, to release a single as part of their 52x52: A Year In Your Ear project. Her single \\"Lone Sailor,\\" produced by Geoff Ott, was released September 1, 2014 and reached #4 on the iTunes Blues charts upon its release.In 2013, Amber released two E.P.s: The Starting Line (April 16) and Christmas Time (November 28). Both were released worldwide through CD Baby and are available on iTunes, Amazon, CD Baby, Spotify, Pandora Radio and more. Upon release of The Starting Line, Antimusic said, \\"In an age of auto-tuned so-called singers, a truly gifted singer like roots rocker Amber Sweeney is a breath of much needed fresh air.\\"Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide. Amber''s voice, musical talent, and songwriting have also been featured in two CW television series: One Tree Hill and Life Unexpected (\\"Flying Machine,\\" \\"Girl In The Moon,\\" \\"Quicksand,\\" \\"Maybe,\\" \\"Stars,\\" \\"Feel This\\" - written by Jonathan Jackson of Enation) while one half of the duo known as Everly. Her voice has also been featured in Stephen King''s film adaptation of Riding The Bullet, while bass player and back up singer for the rock band Enation. She can also be heard on another northwest band''s album, The Alleged Album by One From Many (\\"Tears We Cry Alone\\" and \\"Shape Of Your Heart\\").Amber has been privileged to play at a variety of venues over the years, including: Hard Rock Cafe Seattle (Seattle, WA) Maryhill Winery (Goldendale, WA), Bossanova Ballroom (Portland, OR), Genghis Cohen''s (Los Angeles, CA), The Corn Palace (Mitchell, SD), The Whiskey A Go-Go (Los Angeles, CA), The Troubador (Los Angeles, CA) The Rutledge - Tin Pan South (Nashville, TN), Moulton Falls Winery (Yacolt, WA) to name a few. She is known for being engaging and truly entertaining during her live performances. Along with recording and performing, Amber is involved in a number of local and national organizations: As a radio personality for Portland Radio Project, and as a voting member of The Recording Academy. Amber is also affiliated with ASCAP.","isTrending":true,"commission":"30","genre":[{"id":6},{"id":5},{"id":1}],"spotlightUser":{"name":"Amber Sweeney","userType":"BROADCASTER","phone":"879-678-7687","country":"Albania","state":"California","city":"spaze lane, tuffle tower","zip":"456789","paypalEmailId":"ambersweeney1232@gmail.com","address1":"1128, Spaze ITech Park, Phase 3","address2":"Sec-49, Sohna Road, link road, safire mall"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (462, '2019-06-14 13:02:26', '{"id":10,"displayName":"Amanda","shortDesc":"Amanda X is a post-punk power pop all-female trio from Philadelphia.They have also received press coverage from Rolling Stone Magazine and The Guardian.The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar.","biography":"Amanda X is a post-punk power pop all-female trio from Philadelphia. Billboard magazine has called them \\"leaders in their scene\\" and has described their harmonies as thrash power-pop. They have also received press coverage from Rolling Stone Magazine and The Guardian.[1][3] The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar..","isTrending":true,"commission":"30","genre":[{"id":1},{"id":5}],"spotlightUser":{"name":"Amanda-X","userType":"BROADCASTER","phone":"878-768-8799","country":"Albania","state":"Oregon","city":"Canadian Alliance","zip":"95820","paypalEmailId":"amandax@gmail.com","address1":"45 Jockey Hollow Street Sacramento","address2":"8488 Arlington Road Fairfax"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
