INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (473, '2019-06-14 16:47:04', '{"displayName":"Real conversations in Digital Age","description":"Join us to hear from policy makers, clinical psychologists, business leaders, senior editors, top marketers, media and thought leaders who will gather to deliberate the consequences of losing art of conversation. One hour workshop by world renowned master action learning coach Ron McLuckie is highlight of the day. This is leading to a friendless and depressed society. This has serious repercussions for brands and businesses apart from adverse impact on the personal lives of people. We as a society are dehumanising. Accept it or not, most of us run away from face-to-face conversations. WIYLD are on a mission to reclaim conversations and make world a better and happier place to live in. The world of more face-to-face talks than texting, constant comparisons and desire for validation. Thought leaders like Anurag Batra, Subhrangshu Neogi, Arvind Pandit, Dr Roma Kumar, Vivek Mishra, Ron McLuckie, Shweta Shalini, Mohit Gupta, Dr Sushil Kumar and many more speak during the conclave","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"PST","eventPreviewUrl":"","totalSeats":30,"eventDuration":28,"actualPrice":2,"pricingRule":{"id":2},"liveStreamConfig":{"id":2},"eventType":[{"id":1}],"broadcasterInfo":{"id":12}}', 'Event', 'createEvent', 1);
