INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (528, '2019-06-19 00:08:16', '{"id":14,"displayName":"Mohit","shortDesc":"Good","biography":"Nature, in the broadest sense, is the natural, physical, or material world or universe.  can refer to the phenomena of the physical world, and also to life in general. The study of nature is a large, if not the only, part of science.","isTrending":false,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"mohit Janghu","userType":"BROADCASTER","phone":"9876554431","country":"India","state":"Haryana","city":"Gurgaon","zip":"122001","paypalEmailId":"mohit.janghu@imaginei.in","address1":"1128, Spaze ITech Park, Tower A","address2":"Sec-49, Sohna Road"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 16);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (529, '2019-06-19 00:09:00', '{"id":15,"displayName":"jyoti","shortDesc":"Every single time I’m in the gardens I’ll notice I have a huge smile on my face, It’s pure bliss to feel so connected to something greater than myself, and at the same time, feel accepted as a unique part of what surrounds me.","biography":"It is important for us to get outside and enjoy, appreciate, and learn from this beautiful natural world of ours… To be moved by the oceans, lakes, mountains, streams, valleys, wind, stars, hills, sky, clouds, trees, meadows, flowers, and more, is an amazing gift. To be in Nature inspires care and action on behalf of our environment, and great love for our “home sweet home” on this planet Earth.","isTrending":false,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"jyoti edit 2","userType":"BROADCASTER","phone":"8765432190","country":"United States","state":"california","city":"Los Angeles","zip":"28201","paypalEmailId":"jyoti22july@gmail.com","address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 16);
