INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (538, '2019-06-19 00:12:51', '{"id":59,"displayName":"Shubhi","shortDesc":"Students are assigned scenes from TV and Film to work in this class. In addition to training, successful actors must develop strong marketing skills in order to build a career.","biography":"Acting is an art and the ways with which an actor does acting is the part of craft. Such as how to breath, how to move, how to use his voice and how to relax. The practical knowledge of camera technique is often missed in traditional acting classes. This course is an intensive, total immersion workshop focusing on the essential techniques of acting in front of the camera.Students learn the basics of film acting: calibrating performances based upon shot size and angle, eye line, hitting marks, emotional and physical continuity, and strength and imagination in acting choices. Students are assigned scenes from TV and Film to work in this class.","isTrending":false,"commission":"25.68","genre":[{"id":7},{"id":12}],"spotlightUser":{"name":"Shubhi Tyagi","userType":"BROADCASTER","phone":"987-654-3210","country":"Austria","state":"Madhya pradesh","city":"Gwalior","zip":"9765986","paypalEmailId":"shubhi@gmail.com","address1":"Andheri west","address2":"F-234"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 16);
