INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (560, '2019-06-19 00:39:43', '{"id":13,"displayName":"Family Force 5","shortDesc":"FF5 (formerly known as Family Force 5, The Phamily, Ground Noise and The Brothers) is an American Christian rock band from Atlanta, Georgia","biography":"FF5 (formerly known as Family Force 5, The Phamily, Ground Noise and The Brothers) is an American Christian rock band from Atlanta, Georgia.[1] The band formed in 2005 by brothers Solomon \\"Soul Glow Activatur\\", Joshua \\"Fatty\\", and Jacob \\"Crouton\\" Olds along with their two friends, Nathan Currin \\"Nadaddy\\" and Brad Allen \\"20 Cent\\" later replaced by Derek Mount \\"Chapstique\\". The group has released five studio albums, nine EPs, and two remix albums. They are often noted for their raucous, party-centric personae and eclectic mix of genres, ranging from rap metal to dance-pop.","isTrending":false,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"Family Force 5","userType":"BROADCASTER","phone":"","country":"United States","state":"MN","city":"Bemidji","zip":"56601","paypalEmailId":"priancasaini7591@gmail.com","address1":"35 SW.","address2":"Vermont Drive"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 16);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (561, '2019-06-19 00:41:31', '{"id":10,"displayName":"Amanda","shortDesc":"Amanda X is a post-punk power pop all-female trio from Philadelphia.They have also received press coverage from Rolling Stone Magazine and The Guardian.The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar.","biography":"Amanda X is a post-punk power pop all-female trio from Philadelphia. Billboard magazine has called them \\"leaders in their scene\\" and has described their harmonies as thrash power-pop. They have also received press coverage from Rolling Stone Magazine and The Guardian.[1][3] The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar..","isTrending":false,"commission":"30","genre":[{"id":5},{"id":1}],"spotlightUser":{"name":"Amanda-X","userType":"BROADCASTER","phone":"878-768-8799","country":"Albania","state":"Oregon","city":"Canadian Alliance","zip":"95820","paypalEmailId":"amandax@gmail.com","address1":"45 Jockey Hollow Street Sacramento","address2":"8488 Arlington Road Fairfax"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 16);
