INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (639, '2019-06-27 17:58:55', '{"id":7,"displayName":"Jason_Becker","shortDesc":"Becker''s performing career was cut short by amyotrophic lateral sclerosis (ALS). In 1996, Becker lost the ability to speak, and he now communicates with his eyes via a system developed by his father.","biography":"Jason Eli Becker (born July 22, 1969) is an American musician, songwriter and composer. At the age of 16, he became part of the Shrapnel Records-produced duo Cacophony with his friend Marty Friedman. They released the albums Speed Metal Symphony in 1987 and Go Off! in 1988. Cacophony broke up in 1989 and Becker began doing solo work, having released his first album Perpetual Burn in 1988, also through Shrapnel. He later joined David Lee Roth''s band and recorded one album with him, A Little Ain''t Enough.","isTrending":true,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"Jason Becker","userType":"BROADCASTER","phone":"7287585378","country":"Argentina","state":"Floridaa","city":"Miamii","zip":"33102","paypalEmailId":"jason.becker@gmail.com","address1":"9191 West Valley Farms St . Williamstown","address2":"Miami Beach"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (640, '2019-06-27 18:00:55', '{"id":4,"displayName":"Steve","shortDesc":"Just like his brothers Jeff and Mike, Steve Porcaro started out as a drummer under the tutelage of his father Joe Porcaro, before taking up piano. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums","biography":"Porcaro''s touring career began playing with Gary Wright during his tour in 1977, supporting the latter''s The Dream Weaver album. Porcaro and the other original members of Toto then played with Boz Scaggs before forming Toto. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums, with the exception of Isolation. His two older brothers Mike and Jeff were Toto''s bassist and drummer as well as session musicians while his father Joe is a prolific session percussionist. Unlike most of his Toto bandmates, he generally did not contribute lead or even backing vocals; he considered himself a weak singer, and sang lead on two of his earlier compositions only because he felt that the vocal styles of his bandmates, with the exception of Joseph Williams, were not appropriate for his songs.[3] The song \\"Rosanna\\" was inspired by Porcaro''s girlfriend at the time, Rosanna Arquette. He left Toto in 1987 after the Fahrenheit album in order to pursue a more full-time songwriting and composing career. However, Porcaro continued working with Toto in various supporting capacities, assisting with keyboards, drum looping, synthesizers and arranging/composing. Porcaro composed the music for the song \\"Human Nature\\" and produced the synthesizer for \\"The Girl Is Mine\\" from Michael Jackson''s album Thriller as well as playing synthesizer and keyboard on \\"Stranger In Moscow\\" from Jackson''s HIStory album.He has also done session musician work for many other acts, including Yes (on Union and Open Your Eyes) and Jefferson Airplane (on their self-titled 1989 reunion album). He was also a member of Chris Squire''s short lived band, The Chris Squire Experiment, in 1992.Steve Porcaro is currently working on film scores. He composed the music for the FX television show Justified, among many other projects.He collaborated with his daughter Heather Porcaro on her debut album, The Heartstring Symphony, released in 2009.","isTrending":true,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"steve Porcaro","userType":"BROADCASTER","phone":"9876543210","country":"American Samoa","state":"california","city":"Los Angeles","zip":"28201","paypalEmailId":"steveporcaro@gmail.com","address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (641, '2019-06-27 18:08:10', '{"id":262,"displayName":"Jass Manak","description":"Jass Manak mainly works in Punjabi Music Industry. He started his singing career with ‘U Turn’ (2017). He also featured in several Famous Punjabi Songs like, Dhoka, Hanju, U-Turn, Yaari, Without You etc. His genre is Punjabi-Bollywood and His song list includes Girlfriend, Prada, Viah, Suit Punjabi, Chehra Tera, Age 19, Kalli Ho Gayi and a lot more. He released his most famous song “Prada” on 13 th June’18 and received more than 4 million views and 30,000 likes within 24 hours after uploading the video on You Tube.","country":"","state":"","city":"","zip":"","address1":"","address2":"","isTrending":true,"chatEnabled":true,"timezone":"PST","eventPreviewUrl":"","totalSeats":100,"eventDuration":60,"actualPrice":40,"pricingRule":{"id":4},"liveStreamConfig":{"id":2},"eventType":[{"id":10}],"broadcasterInfo":{"id":12}}', 'Event', 'updateEvent', 1);
