INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (643, '2019-06-28 17:49:12', '{"id":5,"displayName":"victoria","shortDesc":"Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to.","biography":"V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.","isTrending":true,"commission":"30","genre":[{"id":6},{"id":5}],"spotlightUser":{"name":"Victoria contraras","userType":"BROADCASTER","phone":"7876544224","country":"Albania","state":"california","city":"Los Angeles","zip":"2010145","paypalEmailId":"victoriacontraras@gmail.in","address1":"45 Jockey Hollow Street Sacramento","address2":"Miami Beach"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (644, '2019-06-28 17:50:05', '{"id":1,"displayName":"Angeline","shortDesc":"Her resume includes work in an amazing array of styles, including jazz, rock, fusion, funk, R&B, pop, hip hop, and even flamenco/speed metal.","biography":"One minute of Angeline’s low-end thumping coming at you and you’ll know she is just as much beast as beauty.  She is a monstrous talent and has the schedule to prove it.  In the last year alone, Angeline recorded 2 albums and toured with the Narada Michael Walden Band, rocked the stage with Santana when he joined Narada’s band at their most recent show, joined forces with reggae and ska legend Ernest Ranglin, laid down some serious shredding bass on Gretchen Menn’s album Hale Souls (and works regularly as her touring bassist), recorded 4 instructional DVD’s for Hal Leonard as well as a demo video for GHS strings, joined the all-female Led Zeppelin tribute band Zepparella and continues to moonlight as a hired gun in the studio and for local shows.","isTrending":true,"commission":"30","genre":[{"id":4},{"id":1}],"spotlightUser":{"name":"Angeline Saris","userType":"BROADCASTER","phone":"9876543210","country":"","state":"California","city":"Los Angeles","zip":"2010145","paypalEmailId":"Priyanka@imaginei.in","address1":"20/7, Gulmohar Road","address2":"Shipra suncity"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (645, '2019-07-02 14:07:05', '{"id":12,"displayName":"watson","shortDesc":"Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.In 2016, Gibson ranked Wilson the eighth- greatest female guitarist of all time","biography":"Nancy Lamoureaux Wilson (born March 16, 1954) is an American musician, singer, songwriter, producer, and composer. She rose to fame alongside her older sister, singer Ann Wilson, as a guitarist and backing vocalist in the rock band Heart, which she joined in 1974.Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.[4] In 2016, Gibson ranked Wilson the eighth-greatest female guitarist of all time","isTrending":true,"commission":"20","genre":[{"id":4},{"id":2},{"id":1},{"id":10}],"spotlightUser":{"name":"Nancy watson","userType":"BROADCASTER","phone":"(789)-898-3933","country":"Austria","state":"california","city":"Los Angeles","zip":"89856523","paypalEmailId":"shivani.tyagi@imaginei.in","address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
