INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (709, '2019-07-15 16:38:12', '{"id":41,"displayName":"Rory McKernan","shortDesc":"McKernan, the host of the CrossFit Games and a former L1 Seminar Staff member, was one of the CrossFit media team’s first hires a decade ago.","biography":"Rory Mckernan is a strength and conditioning coach specializing in CrossFit ® with 15 years of experience in the field. As a seminar presenter and the Official Host of the CrossFit Games for a decade, Rory has the ability to deliver instruction elegantly. This allows you to turn your brain off and enjoy getting more fit, more quickly.","isTrending":true,"commission":"30","genre":[{"id":7}],"spotlightUser":{"name":"Rory McKernan","userType":"BROADCASTER","phone":"1231231234","country":"","state":"","city":"","zip":"","paypalEmailId":"rorymckernan@gmail.com","address1":"","address2":""}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (710, '2019-07-15 16:45:17', '{"id":12,"displayName":"watson","shortDesc":"Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.In 2016, Gibson ranked Wilson the eighth- greatest female guitarist of all time","biography":"Nancy Lamoureaux Wilson (born March 16, 1954) is an American musician, singer, songwriter, producer, and composer. She rose to fame alongside her older sister, singer Ann Wilson, as a guitarist and backing vocalist in the rock band Heart, which she joined in 1974.Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.[4] In 2016, Gibson ranked Wilson the eighth-greatest female guitarist of all time","isTrending":true,"commission":"20","genre":[{"id":10},{"id":1},{"id":2},{"id":4}],"spotlightUser":{"name":"Nancy watson","userType":"BROADCASTER","phone":"(789)-898-3933","country":"Austria","state":"california","city":"Los Angeles","zip":"89856523","paypalEmailId":"shivani.tyagi@imaginei.in","address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (711, '2019-07-15 16:49:01', '{"id":7,"displayName":"Jason_Becker","shortDesc":"Becker''s performing career was cut short by amyotrophic lateral sclerosis (ALS). In 1996, Becker lost the ability to speak, and he now communicates with his eyes via a system developed by his father.","biography":"Jason Eli Becker (born July 22, 1969) is an American musician, songwriter and composer. At the age of 16, he became part of the Shrapnel Records-produced duo Cacophony with his friend Marty Friedman. They released the albums Speed Metal Symphony in 1987 and Go Off! in 1988. Cacophony broke up in 1989 and Becker began doing solo work, having released his first album Perpetual Burn in 1988, also through Shrapnel. He later joined David Lee Roth''s band and recorded one album with him, A Little Ain''t Enough.","isTrending":true,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"Jason Becker","userType":"BROADCASTER","phone":"7287585378","country":"Argentina","state":"Floridaa","city":"Miamii","zip":"33102","paypalEmailId":"jason.becker@gmail.com","address1":"9191 West Valley Farms St . Williamstown","address2":"Miami Beach"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (712, '2019-07-15 16:58:10', '{"id":5,"displayName":"victoria","shortDesc":"Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to.","biography":"V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.","isTrending":true,"commission":"30","genre":[{"id":5},{"id":6}],"spotlightUser":{"name":"Victoria contraras","userType":"BROADCASTER","phone":"7876544224","country":"Albania","state":"california","city":"Los Angeles","zip":"2010145","paypalEmailId":"victoriacontraras@gmail.in","address1":"45 Jockey Hollow Street Sacramento","address2":"Miami Beach"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (713, '2019-07-15 17:00:43', '{"id":4,"displayName":"Steve","shortDesc":"Just like his brothers Jeff and Mike, Steve Porcaro started out as a drummer under the tutelage of his father Joe Porcaro, before taking up piano. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums","biography":"Porcaro''s touring career began playing with Gary Wright during his tour in 1977, supporting the latter''s The Dream Weaver album. Porcaro and the other original members of Toto then played with Boz Scaggs before forming Toto. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums, with the exception of Isolation. His two older brothers Mike and Jeff were Toto''s bassist and drummer as well as session musicians while his father Joe is a prolific session percussionist. Unlike most of his Toto bandmates, he generally did not contribute lead or even backing vocals; he considered himself a weak singer, and sang lead on two of his earlier compositions only because he felt that the vocal styles of his bandmates, with the exception of Joseph Williams, were not appropriate for his songs.[3] The song \\"Rosanna\\" was inspired by Porcaro''s girlfriend at the time, Rosanna Arquette. He left Toto in 1987 after the Fahrenheit album in order to pursue a more full-time songwriting and composing career. However, Porcaro continued working with Toto in various supporting capacities, assisting with keyboards, drum looping, synthesizers and arranging/composing. Porcaro composed the music for the song \\"Human Nature\\" and produced the synthesizer for \\"The Girl Is Mine\\" from Michael Jackson''s album Thriller as well as playing synthesizer and keyboard on \\"Stranger In Moscow\\" from Jackson''s HIStory album.He has also done session musician work for many other acts, including Yes (on Union and Open Your Eyes) and Jefferson Airplane (on their self-titled 1989 reunion album). He was also a member of Chris Squire''s short lived band, The Chris Squire Experiment, in 1992.Steve Porcaro is currently working on film scores. He composed the music for the FX television show Justified, among many other projects.He collaborated with his daughter Heather Porcaro on her debut album, The Heartstring Symphony, released in 2009.","isTrending":true,"commission":"30","genre":[{"id":1}],"spotlightUser":{"name":"steve Porcaro","userType":"BROADCASTER","phone":"9876543210","country":"American Samoa","state":"california","city":"Los Angeles","zip":"28201","paypalEmailId":"steveporcaro@gmail.com","address1":"9191 West Valley Farms St . Williamstown","address2":"113,Roosevelt Street Lithonia"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (714, '2019-07-15 17:03:07', '{"id":2,"displayName":"Amber","shortDesc":"Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide.","biography":"Amber Sweeney is an accomplished soul/rock singer, songwriter, and recording artist who recently signed with Seattle-based record label, London Tone Music, to release a single as part of their 52x52: A Year In Your Ear project. Her single \\"Lone Sailor,\\" produced by Geoff Ott, was released September 1, 2014 and reached #4 on the iTunes Blues charts upon its release.In 2013, Amber released two E.P.s: The Starting Line (April 16) and Christmas Time (November 28). Both were released worldwide through CD Baby and are available on iTunes, Amazon, CD Baby, Spotify, Pandora Radio and more. Upon release of The Starting Line, Antimusic said, \\"In an age of auto-tuned so-called singers, a truly gifted singer like roots rocker Amber Sweeney is a breath of much needed fresh air.\\"Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide. Amber''s voice, musical talent, and songwriting have also been featured in two CW television series: One Tree Hill and Life Unexpected (\\"Flying Machine,\\" \\"Girl In The Moon,\\" \\"Quicksand,\\" \\"Maybe,\\" \\"Stars,\\" \\"Feel This\\" - written by Jonathan Jackson of Enation) while one half of the duo known as Everly. Her voice has also been featured in Stephen King''s film adaptation of Riding The Bullet, while bass player and back up singer for the rock band Enation. She can also be heard on another northwest band''s album, The Alleged Album by One From Many (\\"Tears We Cry Alone\\" and \\"Shape Of Your Heart\\").Amber has been privileged to play at a variety of venues over the years, including: Hard Rock Cafe Seattle (Seattle, WA) Maryhill Winery (Goldendale, WA), Bossanova Ballroom (Portland, OR), Genghis Cohen''s (Los Angeles, CA), The Corn Palace (Mitchell, SD), The Whiskey A Go-Go (Los Angeles, CA), The Troubador (Los Angeles, CA) The Rutledge - Tin Pan South (Nashville, TN), Moulton Falls Winery (Yacolt, WA) to name a few. She is known for being engaging and truly entertaining during her live performances. Along with recording and performing, Amber is involved in a number of local and national organizations: As a radio personality for Portland Radio Project, and as a voting member of The Recording Academy. Amber is also affiliated with ASCAP.","isTrending":true,"commission":"30","genre":[{"id":5},{"id":1},{"id":6}],"spotlightUser":{"name":"Amber Sweeney","userType":"BROADCASTER","phone":"879-678-7687","country":"Albania","state":"California","city":"spaze lane, tuffle tower","zip":"456789","paypalEmailId":"ambersweeney1232@gmail.com","address1":"1128, Spaze ITech Park, Phase 3","address2":"Sec-49, Sohna Road, link road, safire mall"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (715, '2019-07-15 17:06:43', '{"id":1,"displayName":"Angeline","shortDesc":"Her resume includes work in an amazing array of styles, including jazz, rock, fusion, funk, R&B, pop, hip hop, and even flamenco/speed metal.","biography":"One minute of Angeline’s low-end thumping coming at you and you’ll know she is just as much beast as beauty.  She is a monstrous talent and has the schedule to prove it.  In the last year alone, Angeline recorded 2 albums and toured with the Narada Michael Walden Band, rocked the stage with Santana when he joined Narada’s band at their most recent show, joined forces with reggae and ska legend Ernest Ranglin, laid down some serious shredding bass on Gretchen Menn’s album Hale Souls (and works regularly as her touring bassist), recorded 4 instructional DVD’s for Hal Leonard as well as a demo video for GHS strings, joined the all-female Led Zeppelin tribute band Zepparella and continues to moonlight as a hired gun in the studio and for local shows.","isTrending":true,"commission":"30","genre":[{"id":1},{"id":4}],"spotlightUser":{"name":"Angeline Saris","userType":"BROADCASTER","phone":"9876543210","country":"","state":"California","city":"Los Angeles","zip":"2010145","paypalEmailId":"Priyanka@imaginei.in","address1":"20/7, Gulmohar Road","address2":"Shipra suncity"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (716, '2019-07-15 17:10:39', '{"id":9,"displayName":"Sara","shortDesc":"Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their \\"New Buzz Artist,\\".Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.","biography":"Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their \\"New Buzz Artist,\\" calling her \\"one of the most fearless singer-songwriters on the planet.\\" Her timeless, infectious, songs blur boundaries between folk, rock, pop, and country. Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.  Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their \\"New Buzz Artist,\\" calling her \\"one of the most fearless singer-songwriters on the planet.\\" Her timeless, infectious, songs blur boundaries between folk, rock, pop, and country. Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.","isTrending":true,"commission":"30","genre":[{"id":1},{"id":6}],"spotlightUser":{"name":"Sara Melson","userType":"BROADCASTER","phone":"9786267278","country":"Argentina","state":"california","city":"Los Angeles","zip":"2010145","paypalEmailId":"saramelson@gmail.com","address1":"45 Jockey Hollow Street Sacramento","address2":"Miami Beach"}}', 'BroadcasterInfo', 'updateBroadcasterUser', 1);
