INSERT INTO spotlight.audit_log (id, created_on, description, module, operation, spotlight_user_id) VALUES (766, '2019-07-23 13:19:18', '{"displayName":"Big bang blues","description":"Delhi-based Big Bang Blues is now a decade old and has performed over 300 shows. Most memorable being Mahindra Blues Festival and Macau Blues and Jazz Festival. They recently finished an India tour with SkyEyes. 9the August performance will see Sushant Thakur on Guitars and Diyatom Deb on vocals backed by an absolutely NEW rhythm section - the very versatile Archit Agrawal on Bass and promising young talent Vasudev Singh on Drums. Joining us for the night on Keys will be Mohit Dimri. The band will bring a wide mix of contemporary Blues-rock of Walter Trout, Allman Brothers, Cream, Jimi Hendrix and some good old Electric Blues of BB King, Stevie Ray Vaughan","country":null,"state":"","city":"","zip":"","address1":"","address2":"","isTrending":false,"chatEnabled":true,"timezone":"PST","eventPreviewUrl":"","totalSeats":"100","eventDuration":50,"actualPrice":40,"pricingRule":{"id":4},"liveStreamConfig":{"id":2},"eventType":[{"id":10}],"broadcasterInfo":{"id":17}}', 'Event', 'createEvent', 1);
