INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (1, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Angeline1563190602812.png', 'One minute of Angeline’s low-end thumping coming at you and you’ll know she is just as much beast as beauty.  She is a monstrous talent and has the schedule to prove it.  In the last year alone, Angeline recorded 2 albums and toured with the Narada Michael Walden Band, rocked the stage with Santana when he joined Narada’s band at their most recent show, joined forces with reggae and ska legend Ernest Ranglin, laid down some serious shredding bass on Gretchen Menn’s album Hale Souls (and works regularly as her touring bassist), recorded 4 instructional DVD’s for Hal Leonard as well as a demo video for GHS strings, joined the all-female Led Zeppelin tribute band Zepparella and continues to moonlight as a hired gun in the studio and for local shows.', 'Angeline', true, 'Her resume includes work in an amazing array of styles, including jazz, rock, fusion, funk, R&B, pop, hip hop, and even flamenco/speed metal.', 'Active', 'hhIJSaSbXHyZBaozN1vDdzyPxLastKYHbihGVFcAtuU27EPTa2GiiAPgrZ6U4rN5', 4);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (2, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Amber1563190386839.png', 'Amber Sweeney is an accomplished soul/rock singer, songwriter, and recording artist who recently signed with Seattle-based record label, London Tone Music, to release a single as part of their 52x52: A Year In Your Ear project. Her single "Lone Sailor," produced by Geoff Ott, was released September 1, 2014 and reached #4 on the iTunes Blues charts upon its release.In 2013, Amber released two E.P.s: The Starting Line (April 16) and Christmas Time (November 28). Both were released worldwide through CD Baby and are available on iTunes, Amazon, CD Baby, Spotify, Pandora Radio and more. Upon release of The Starting Line, Antimusic said, "In an age of auto-tuned so-called singers, a truly gifted singer like roots rocker Amber Sweeney is a breath of much needed fresh air."Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide. Amber''s voice, musical talent, and songwriting have also been featured in two CW television series: One Tree Hill and Life Unexpected ("Flying Machine," "Girl In The Moon," "Quicksand," "Maybe," "Stars," "Feel This" - written by Jonathan Jackson of Enation) while one half of the duo known as Everly. Her voice has also been featured in Stephen King''s film adaptation of Riding The Bullet, while bass player and back up singer for the rock band Enation. She can also be heard on another northwest band''s album, The Alleged Album by One From Many ("Tears We Cry Alone" and "Shape Of Your Heart").Amber has been privileged to play at a variety of venues over the years, including: Hard Rock Cafe Seattle (Seattle, WA) Maryhill Winery (Goldendale, WA), Bossanova Ballroom (Portland, OR), Genghis Cohen''s (Los Angeles, CA), The Corn Palace (Mitchell, SD), The Whiskey A Go-Go (Los Angeles, CA), The Troubador (Los Angeles, CA) The Rutledge - Tin Pan South (Nashville, TN), Moulton Falls Winery (Yacolt, WA) to name a few. She is known for being engaging and truly entertaining during her live performances. Along with recording and performing, Amber is involved in a number of local and national organizations: As a radio personality for Portland Radio Project, and as a voting member of The Recording Academy. Amber is also affiliated with ASCAP.', 'Amber', true, 'Amber''s music from The Staring Lineand Christmas Time have been featured on Seattle Wave Radio, Portland Radio Project, KMUZ, KZME, and KINK''s Homegrown Spotlight, among many other streaming stations worldwide.', 'Active', 'VUHBG4a8GZvhFztDindrOohYMU1BfhAsAnAVcY3Xt8QgFpEtPH0LBrF22TcmtgIs', 5);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (3, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1551776002445-calling_1.jpeg', 'Calling Glory''s latest radio single, I AM With You, is the bands first song to be eligible for a Grammy Nomination, best Contemporary Christian Song of The Year, and recently reached #44 on Billboard Christian Charts! I Am With You is the band''s follow up to hit song "Don''t Give Up" -- the bands first song to reach #24 on Billboard Christian Charts. Calling Glory can be heard on stations like K-Love, Air 1, SiriusXM (The Message) and numerous other Christian radio stations across the USA. Soncured Records artist, Calling Glory, has taken Independent Christian Music by storm with over 50,000 fans on Facebook and scheduled tour dates around the east coast.  Since forming in 2008, the band has consistently focused on "writing Christ centered music that reflects a grateful hearts response to the gospel."  The band members go on to explain, "We pray that through our music, listeners will be challenged to consider the cross, the sacrifice made there!".The band- consisting of Dana Potvin, Jones Beene, Drew Crabtree, and Logan Early- released their first EP Daylight in the fall of 2009, which was followed by Teach Me to Love in 2011, and From Heaven To Earth in 2013.  The band is currently recording a new worship project that is set to release in late 2014.  The guys write their own music as well as cover modern worship songs and classic hymns, "We like to think of ourselves as not just a band but a worship band." said guitarist Jones Beene. Lead Singer Dana Potvin explains "We hope that we can not only encourage the body of Christ, but also challenge them to go deeper in their relationship with Him."', 'Glory', true, 'Calling Glory''s latest radio single, I AM With You, is the bands first song to be eligible for a Grammy Nomination, best Contemporary Christian Song. Lead Singer Dana Potvin explains "We hope that we can not only encourage the body of Christ.', 'Inactive', '33tvgBGFanvMB3EeS0jPlVEKa72taX3lXaCYPD1VYPLnEVsI6xJu9JcRd28bNUZ7', 6);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (4, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Steve1563190242599.png', 'Porcaro''s touring career began playing with Gary Wright during his tour in 1977, supporting the latter''s The Dream Weaver album. Porcaro and the other original members of Toto then played with Boz Scaggs before forming Toto. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums, with the exception of Isolation. His two older brothers Mike and Jeff were Toto''s bassist and drummer as well as session musicians while his father Joe is a prolific session percussionist. Unlike most of his Toto bandmates, he generally did not contribute lead or even backing vocals; he considered himself a weak singer, and sang lead on two of his earlier compositions only because he felt that the vocal styles of his bandmates, with the exception of Joseph Williams, were not appropriate for his songs.[3] The song "Rosanna" was inspired by Porcaro''s girlfriend at the time, Rosanna Arquette. He left Toto in 1987 after the Fahrenheit album in order to pursue a more full-time songwriting and composing career. However, Porcaro continued working with Toto in various supporting capacities, assisting with keyboards, drum looping, synthesizers and arranging/composing. Porcaro composed the music for the song "Human Nature" and produced the synthesizer for "The Girl Is Mine" from Michael Jackson''s album Thriller as well as playing synthesizer and keyboard on "Stranger In Moscow" from Jackson''s HIStory album.He has also done session musician work for many other acts, including Yes (on Union and Open Your Eyes) and Jefferson Airplane (on their self-titled 1989 reunion album). He was also a member of Chris Squire''s short lived band, The Chris Squire Experiment, in 1992.Steve Porcaro is currently working on film scores. He composed the music for the FX television show Justified, among many other projects.He collaborated with his daughter Heather Porcaro on her debut album, The Heartstring Symphony, released in 2009.', 'Steve', true, 'Just like his brothers Jeff and Mike, Steve Porcaro started out as a drummer under the tutelage of his father Joe Porcaro, before taking up piano. Porcaro wrote or co-wrote at least one song on each of Toto''s first six albums', 'Active', 'qMcWVrQGMfvcIYdkapFDwVcSUUebKNohhZOK3dDLLK3EqrQrtn6hlhyJxKoRcrYf', 7);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (5, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/victoria1563190089767.png', 'V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.V Contreras has the voice of an angel transcending you back in time to 1962. Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to. Victoria and her band, including the ever so popular Andrew Joslyn on the violin, will make you think you are listening to a James Bond soundtrack. This musical image is fitting for Victoria Contreras because she is a women that holds a true level of class and respect. So close your eyes and let her nostalgic sounds take you away into that world of soulful tranquility.', 'victoria', true, 'Her soulful lyrics tell a deep story that gets you lost into a eerie world of love and pain and will make you forget this is truly a different generation of music your listening to.', 'Active', 'kbjgKMxQmSORuaKaSp9w3RnveCR80OKUzzhUDbqSWcFE4yhZQTE2FPU77FlsgJcO', 8);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (6, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1551777129886-Harmony1.jpg', 'To understand why Fifth Harmony is going to go their separate ways, it’s imperative to look at the demise of One Direction. Both One Direction and Fifth Harmony formed on the UK and US versions of The X Factor, in 2010 and 2012 respectively. Each member of One Direction held varying degrees of star power, with Harry Styles and Zayn Malik frequently emerging as the most talked-about. In March 2015, Malik announced he was departing the band, becoming the first member to release a solo album, with Mind of Mine. The band continued on as a four-piece for their fifth album Made in the A.M. but, as many predicted (and feared), the band announced they would be going on hiatus in late 2015. By May 2017, each member of One Direction had released solo singles, with no news as to whether or not they would reunite. Less than a year later, the focus is still on the former One Direction members’ solo work, and there have been no whispers to signal the band will reunite any time soon.', 'Harmony', true, 'Fifth Harmony is an American girl group based in Miami, composed of Ally Brooke, Normani Kordei, Dinah Jane, Lauren Jauregui, and previously Camila.each member of One Direction had released solo singles, whether they or not they would reunite.', 'Inactive', 'dvpRua7AmynQdHIsmBvdVkBWCiJVUNcD1VItgkmAojNCsvHiO015wae69fLd1IsT', 9);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (7, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Jason_Becker1563189540693.png', 'Jason Eli Becker (born July 22, 1969) is an American musician, songwriter and composer. At the age of 16, he became part of the Shrapnel Records-produced duo Cacophony with his friend Marty Friedman. They released the albums Speed Metal Symphony in 1987 and Go Off! in 1988. Cacophony broke up in 1989 and Becker began doing solo work, having released his first album Perpetual Burn in 1988, also through Shrapnel. He later joined David Lee Roth''s band and recorded one album with him, A Little Ain''t Enough.', 'Jason_Becker', true, 'Becker''s performing career was cut short by amyotrophic lateral sclerosis (ALS). In 1996, Becker lost the ability to speak, and he now communicates with his eyes via a system developed by his father.', 'Active', 'BBNvWMz2B4quH43SjVfBr17MtmAcycr0Wfvlxwg43JCQwrK1wYb0fzlSNugWrYi2', 10);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (8, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Gary1562061232511.png', 'He performs on both the West Coast and Hawaii.  He writes original songs as well as creating magical arrangements of folk classics.', 'Gary', true, 'Gary is a singer/songwriter who specializes in folk music.', 'Active', 'slnDIUqVyxvIyqBhvcYp7Fm4VH1W1dvr8pvp8EcxiJKX8QpBCw73CW0SvRRXsLH4', 11);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (9, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/Sara1563191340477.png', 'Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their "New Buzz Artist," calling her "one of the most fearless singer-songwriters on the planet." Her timeless, infectious, songs blur boundaries between folk, rock, pop, and country. Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.  Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their "New Buzz Artist," calling her "one of the most fearless singer-songwriters on the planet." Her timeless, infectious, songs blur boundaries between folk, rock, pop, and country. Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.', 'Sara', true, 'Sara Melson''s insightful and inspiring lyrics and unique, distinctive voice led Yahoo Music to choose her as their "New Buzz Artist,".Sara''s songs have been featured in numerous film & TV shows, including Grey''s Anatomy.', 'Active', '94IzgtQ7BiDfywpZ2Og8B6ra4jgqR7DOBVPffvU8y6Dfavm6IZ1Wju5tQkjgwzC8', 12);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (10, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1555083163865-amandax.jpg', 'Amanda X is a post-punk power pop all-female trio from Philadelphia. Billboard magazine has called them "leaders in their scene" and has described their dfsfsdfsdfasdharmonies as thrash power-pop. They have also received press coverage from Rolling Stone Magazine and The Guardian.[1][3] The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar..', 'Amanda', false, 'Amanda X is a post-punk power pop all-female trio from Philadelphia.They have also redsfsdfsadceived press coverage from Rolling Stone Magazine and The Guardian.The band is composed of Melissa Brain on drums, Kat Bean on bass and Cat Park on guitar.', 'Active', '1v6gondDtLGONleqRw5F4KmOmfT3Ex53cJYO5cnDlX3rOK3abkfuqQcrFjPjeJBr', 13);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (11, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1551780723821-bboys1.jpg', 'The Backstreet Boys (often abbreviated as BSB)[3] are an American vocal group, formed in Orlando, Florida in 1993. The group consists of AJ McLean, Howie Dorough, Nick Carter, Kevin Richardson and Brian Littrell. The group rose to fame with their debut international album, Backstreet Boys (1996). In the following year they released their second international album Backstreet''s Back (1997) along with their self-titled U.S. debut album, which continued the group''s success worldwide. They rose to superstardom with their third studio album Millennium (1999) and its follow-up album, Black & Blue (2000). After a two-year hiatus, they regrouped and released a comeback album Never Gone (2005). After the conclusion of the Never Gone Tour in 2006, Richardson left the group to pursue other interests.[4] The group then released two albums as a quartet: Unbreakable (2007) and This Is Us (2009).In 2012, the group announced that Richardson had rejoined them permanently.[5] In the following year they celebrated their 20th anniversary and released their first independent album, In a World Like This (2013). The group also released their first documentary movie, titled Backstreet Boys: Show ''Em What You''re Made Of in January 2015.', 'backstreet', false, 'Lucky The Backstreet Boys are an American vocal group, formed in Orlando, Florida in 1993. The group consists of AJ McLean, Howie Dorough, Nick Carter, Kevin Richardson and Brian Littrell.', 'Active', 'HW9JQ4D7SNHQzT0wlwv9cAvDNhzOigOtX9zIfFG2VQ86ZKibBjuK4Dd841XaoQnR', 14);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (12, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/watson1563189317056.png', 'Nancy Lamoureaux Wilson (born March 16, 1954) is an American musician, singer, songwriter, producer, and composer. She rose to fame alongside her older sister, singer Ann Wilson, as a guitarist and backing vocalist in the rock band Heart, which she joined in 1974.Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.[4] In 2016, Gibson ranked Wilson the eighth-greatest female guitarist of all time', 'watson', true, 'Wilson has been lauded for her guitar playing, noted for its blending elements of flamenco and classical guitar styles with hard rock.In 2016, Gibson ranked Wilson the eighth- greatest female guitarist of all time', 'Active', 'NkOkrCHsSm2LsAnPsO4S7tubBuDp6fP1XUJKUND3x0ZVzetidQeGzlJEjehZwubH', 17);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (13, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1551789815739-familyforce5.jpg', 'FF5 (formerly known as Family Force 5, The Phamily, Ground Noise and The Brothers) is an American Christian rock band from Atlanta, Georgia.[1] The band formed in 2005 by brothers Solomon "Soul Glow Activatur", Joshua "Fatty", and Jacob "Crouton" Olds along with their two friends, Nathan Currin "Nadaddy" and Brad Allen "20 Cent" later replaced by Derek Mount "Chapstique". The group has released five studio albums, nine EPs, and two remix albums. They are often noted for their raucous, party-centric personae and eclectic mix of genres, ranging from rap metal to dance-pop.', 'Family Force 5', false, 'FF5 (formerly known as Family Force 5, The Phamily, Ground Noise and The Brothers) is an American Christian rock band from Atlanta, Georgia', 'Active', '6vhS3QXUNMWoXH4rCLVp1VWDhECGjnlCBAd6AuWSJWu2umVAzyR1tTQHhhMFX6sC', 18);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (14, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1553101369377-1553101362679.jpg', 'Nature, in the broadest sense, is the natural, physical, or material world or universe.  can refer to the phenomena of the physical world, and also to life in general. The study of nature is a large, if not the only, part of science.', 'Mohit', false, 'Good', 'Active', 'gtwZgihyzBvkntNddXTeJc11uXJtM9ZeX1yncQ3MLZIW89WDzvBzvz15XMaPLx7j', 19);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (15, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1560415135277-1553075892651.jpg', 'It is important for us to get outside and enjoy, appreciate, and learn from this beautiful natural world of ours… To be moved by the oceans, lakes, mountains, streams, valleys, wind, stars, hills, sky, clouds, trees, meadows, flowers, and more, is an amazing gift. To be in Nature inspires care and action on behalf of our environment, and great love for our “home sweet home” on this planet Earth.', 'jyoti', false, 'Every single time I’m in the gardens I’ll notice I have a huge smile on my face, It’s pure bliss to feel so connected to something greater than myself, and at the same time, feel accepted as a unique part of what surrounds me.', 'Active', 'Lakmjxywuc3wv0RFNmZmUtIj9UpiJQh3zs6pEizaAd9ugpwJYfBVE2KGI8cf7Wci', 20);
