INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (41, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/RoryMcKernan1563188891466.png', 'Rory Mckernan is a strength and conditioning coach specializing in CrossFit ® with 15 years of experience in the field. As a seminar presenter and the Official Host of the CrossFit Games for a decade, Rory has the ability to deliver instruction elegantly. This allows you to turn your brain off and enjoy getting more fit, more quickly.', 'Rory McKernan', true, 'McKernan, the host of the CrossFit Games and a former L1 Seminar Staff member, was one of the CrossFit media team’s first hires a decade ago.', 'Active', '6RJeAlSbfBe5jJ3OiwhQ31aWIewIBqfaJmaqLAjGVCs2D3OurbwaznNvUPUFf3qV', 54);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (42, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/CashBlack1563188677046.png', 'Hello I''m Cash Black. I''m an actor, singer, and song writer based in Los Angeles. Im pretty good at telling stories and I''m really good at having fun.', 'Cash Black', true, '', 'Active', 'WlERBevy7EXePmHbliAkGfo3UjSXW0vtR8piYMb4GbkF974w5THWxInMlOLgnrlj', 55);
