INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (54, 'https://s3.us-west-2.amazonaws.com/awsqa-spotlight/ClaudiaSix1563191460598.png', 'Born and raised in France, she brings an ease with the topic of sexuality. She is inherently sex-positive and maintains a broad perspective by taking factors such as biological, psychological, sociological, anthropological and historical into consideration when addressing sexual issues. She is regularly invited to speak on the radio and at conferences, and to contribute to popular magazine articles.', 'Claudia Six', true, 'As a Clinical Sexologist I am a trained professional (PhD in Clinical Sexology), with almost twenty five years of experience, specializing in sexual and relationship issues. This is something I know a lot about, and work with exclusively.', 'Active', 'B7eVjFoHFm2fVyuPHCIosO5zNmsK6KNtdCopfL0jnEA01UuHbEoS3yEk0YH7Vj28', 71);
INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (55, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/tanusharma1556602149600.png', 'The Nooran Sisters – Promoting peace through (Sufi, Classical music) Jyoti and Sultana individually of ‘Tung Tung’ fame come from a family of musicians.', 'tanu sharma', false, 'hi', 'Active', 'z536TJ6rbVD8dsW6MpmEabZwRRiNXaFm3SsIyPy6jxk28079ZxD3kuFnuXFtRX1b', 72);
