INSERT INTO spotlight.broadcaster_info (id, banner_url, biography, display_name, is_trending, short_desc, status, unique_name, spotlight_user_id) VALUES (59, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1558523541722-1558523530254.jpg', 'Acting is an art and the ways with which an actor does acting is the part of craft. Such as how to breath, how to move, how to use his voice and how to relax. The practical knowledge of camera technique is often missed in traditional acting classes. This course is an intensive, total immersion workshop focusing on the essential techniques of acting in front of the camera.Students learn the basics of film acting: calibrating performances based upon shot size and angle, eye line, hitting marks, emotional and physical continuity, and strength and imagination in acting choices. Students are assigned scenes from TV and Film to work in this class.', 'Shubhi', false, 'Students are assigned scenes from TV and Film to work in this class. In addition to training, successful actors must develop strong marketing skills in order to build a career.', 'Active', 'qPnIWowf8YPWglEHI2n08w8TpkK9PD1GcATlxAqT6xhZM4SjWh9Jvo2wSAIhj7wN', 84);
