INSERT INTO spotlight.event (id, actual_price, address1, address2, admin_chat_auth_key, broadcaster_chat_auth_key, chat_enabled, city, country, created_on, description, display_name, event_duration, event_image_url, event_preview_url, event_utc_datetime, is_trending, live_stream_data, live_stream_url, state, status, stream_name, timezone, total_seats, unique_name, zip, broadcaster_info_id, live_stream_config_id, pricing_rule_id, show_to_public) VALUES (140, 15, '1128, Spaze ITech Park, Phase 3', 'Sec-49, Sohna Road, link road, safire mall', '7dS70hOIO00EeVoDywtmBLFud9EupzE3', 'TaXpjYYwMM2NusMhPKSMlnNahrPL4cnR', true, 'spaze lane, tuffle tower', 'India', '2019-07-26 09:42:48', 'The show is the experience of a lifetime as it takes you on a journey across the sands of Rajasthan with traditional, little seen instruments playing folk songs, all rendered by 18 amazing musicians led by multi-instrumentalist and vocalist par excellence, Kutle Khan. Backing him are musicians from legendary families such as the Nathulal Solanki’s from Pushkar on Nagaras, Darre Khan of Jaisalmer on the Khamaycha carrying forward the legacy of the inventor of the instrument, his father, Padmashri Sakar Khan. Other musicians on instruments like the Khartal, Morchang, Bhapang, Alogoza, Dholak and Sindhi Saarangi hail from Bikaner, Barmer, Jaisalmer, Jodhpur and Jaipur. The traditional folk dance- the Ghoomar is presented by the famous Sapera family ladies. 
INSERT INTO spotlight.event (id, actual_price, address1, address2, admin_chat_auth_key, broadcaster_chat_auth_key, chat_enabled, city, country, created_on, description, display_name, event_duration, event_image_url, event_preview_url, event_utc_datetime, is_trending, live_stream_data, live_stream_url, state, status, stream_name, timezone, total_seats, unique_name, zip, broadcaster_info_id, live_stream_config_id, pricing_rule_id, show_to_public) VALUES (141, 10, '9191 West Valley Farms St . Williamstown', '113,Roosevelt Street Lithonia', 'SX4NFHPgOvGrEhC5kdbumHEhKHitUIJx', '1E4UHSIW2eLALbZnW9Tm4KsiIBpi3DIK', true, 'Los Angeles', '', '2019-07-26 09:42:48', 'Aditi Malhotra & Vikramaditya Negi are musicians from New Delhi. Aditi is an upcoming singer-songwriter whose journey began at a very early age. Her training as a Hindustani Classical vocalist for nearly ten years made for some of her earliest influences, while her interest led her to explore various different genres of western contemporary music such as soul, RnB, jazz, blues, and bossa nova.A New Delhi based artist, Vikramaditya Negi is a soul that craved to seek the beautiful stories of the world and whose mind hungered for pure artistic brilliance and genius. He strongly devoted himself to his arts at a very early age. Blessed with a genuine sense of sound, he made the most of his talent by carving it into a distinguished skill as he trained under Shri Ajay Kumar Pathak as a Hindustani Classical Dhrupad and Khayaal vocalist.', 'The Piano show The Piano show', 25, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/1554718741882-Screenshot_2019-04-08_at_3.46.37_PM.png', '', '2019-04-09 15:40:31', true, '{"live_stream":{"use_stream_source":false,"player_embed_code":"in_progress","transcoder_type":"transcoded","direct_playback_urls":{"rtmp":[{"name":"source","url":"rtmp://aa799c.entrypoint.cloud.wowza.com/app-5bdc/a714df61"},{"output_id":"j2bfptbf","name":"passthrough","url":"rtmp://aa799c.entrypoint.cloud.wowza