INSERT INTO spotlight.event (id, actual_price, address1, address2, admin_chat_auth_key, broadcaster_chat_auth_key, chat_enabled, city, country, created_on, description, display_name, event_duration, event_image_url, event_preview_url, event_utc_datetime, is_trending, live_stream_data, live_stream_url, state, status, stream_name, timezone, total_seats, unique_name, zip, broadcaster_info_id, live_stream_config_id, pricing_rule_id, show_to_public) VALUES (264, 20, '', '', 'OJuIw9Psi54ncP3Id0WpkogYLLTHknqy', 'CxaN6ir5VVJuTf36fHOYtdoWN8RCJryh', true, '', '', '2019-07-26 09:42:48', 'Join us to hear from policy makers, clinical psychologists, business leaders, senior editors, top marketers, media and thought leaders who will gather to deliberate the consequences of losing art of conversation. One hour workshop by world renowned master action learning coach Ron McLuckie is highlight of the day. This is leading to a friendless and depressed society. This has serious repercussions for brands and businesses apart from adverse impact on the personal lives of people. We as a society are dehumanising. Accept it or not, most of us run away from face-to-face conversations. WIYLD are on a mission to reclaim conversations and make world a better and happier place to live in. The world of more face-to-face talks than texting, constant comparisons and desire for validation. Thought leaders like Anurag Batra, Subhrangshu Neogi, Arvind Pandit, Dr Roma Kumar, Vivek Mishra, Ron McLuckie, Shweta Shalini, Mohit Gupta, Dr Sushil Kumar and many more speak during the conclave', 'Real conversations in Digital Age', 30, 'https://s3.us-west-2.amazonaws.com/awsprod-spotlight/RealconversationsinDigitalAge1560511022068.png', '', '2019-06-17 01:15:11', true, '{"live_stream":{"use_stream_source":false,"player_embed_code":"in_progress","transcoder_type":"transcoded","direct_playback_urls":{"rtmp":[{"name":"source","url":"rtmp://7f7c29.entrypoint.cloud.wowza.com/app-b448/0f91da47"},{"output_id":"p0t7yk4j